import style from "styled-components";
import { GlobalCentralizeDiv } from "../../stylesGlobal";

const person = "person";
const more = "more_vert";

const Icon = style.div`
    width: 100%;
    align-items: center;
    cursor: pointer;
    display: flex;
    justify-content: center;

    span {
        &:hover {
            color: #fff;
            cursor: pointer;
        }
    }

    i {
        display: none;
    }

    @media (max-width: 768px) {

        a {
            text-decoration: none;
            color: #000;
            display: flex;
            align-items: center;
            justify-content: center;

            i {
                margin: 0 1rem;
                font-size: 40px;
                display: inline;
            }
    
      }

    @media (max-width: 481px) {

        a {
            text-decoration: none;
            color: #000;
            display: flex;
            align-items: center;
            justify-content: center;
            
            i {
                margin: 0 1rem;
                font-size: 24px;
                display: inline;
            }
        }

        
    }

`;

function OptionsIconHeader() {
    return (
       <>
            <GlobalCentralizeDiv>
                <Icon>
                    <a href="/"><i className="material-icons ">{person}</i></a>
                    <a href="/"><i className="material-icons">{more}</i></a>
                </Icon>
            </GlobalCentralizeDiv>
        </>
    )
};

export default OptionsIconHeader;
